import React from 'react';
import Nav from '../components/Nav';
import mainBg from '../assets/images/main-bg.jpg';

function Home() {
	return (
		<div>
			<Nav />
			<div className='flex flex-col p-3 items-center md:flex-row'>
				<div className='flex flex-col p-3 items-center gap-5'>
					<h1 className='text-3xl font-bold text-center'>
						Enrich your teaching{' '}
						<span className='text-primary'>experience</span>
					</h1>
					<p className='text-center'>
						Lorem ipsum dolor sit amet, consectetur adipiscing elit. Curabitur
						at turpis non massa auctor mollis. Maecenas in urna vestibulum velit
						pretium posuere.
					</p>
					<button className='btn btn-primary normal-case w-60 mt-3'>
						Get started
					</button>
				</div>
				<div className='m-5'>
					<img src={mainBg} alt='guitars and pianos' className='rounded' />
				</div>
			</div>
		</div>
	);
}

export default Home;
